import React from "react";
import Nav from "./Nav";
import Main from "./Main";
import Footer from "./Footer";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';




const App = () => {

  return (
    <Switch>
      <Nav />
      <Route path="/">
        <Main />
      </Route>
      <Route path="/footer">
        <Footer />
      </Route>
    </Switch>
  );
}

export default App;
